import React from "react";
import logo from "./957-9571167_airbnb-png.png";
export default function Nav(){
    return(
        <section className="nav">
           <nav className="nav">
            <img src={logo} className="App-logo" alt="logo" />{" "}
            <h1>aribnb</h1>
            <ul className="nav-items">
            <li>Pricing</li>
            <li>About</li>
            <li>Contact Us</li>
            </ul>
      </nav>
        </section>
    )
}
